        jsonObj = json.loads(response.body_as_unicode())
        aid = re.search('show_id=(\w+)',response.url).group(1)
        for item in jsonObj['videos']:  
            video = {}
            video['aid'] = aid
            video['id'] = item['id']
            video['title'] = item['title']
            video['stage'] = item['stage']
            video['url'] = item['link']
            video['duration'] = item['duration']
            video['published'] = item['published']
            yield video